import React, { useState, useEffect } from "react";
import { Link } from "react-router-dom";
import "./Product.css"; // Import external CSS

// Importing images from assets folder
import doveImage from "../assets/products/dove.jpg";
import luxImage from "../assets/products/lux.jpg";
import palmoliveImage from "../assets/products/palmolive.jpg";
import headShouldersImage from "../assets/products/head_shoulders.jpg";
import panteneImage from "../assets/products/pantene.jpg";
import colgateImage from "../assets/products/colgate.jpg";
import sensodyneImage from "../assets/products/sensodyne.jpg";
import charminImage from "../assets/products/charmin.jpg";
import scottImage from "../assets/products/scott.jpg";
import fairyImage from "../assets/products/fairy.jpg";
import tideImage from "../assets/products/tide.jpg";
import downyImage from "../assets/products/downy.jpg";

const products = [
    { name: "Dove", category: "soap", image: doveImage },
    { name: "Lux", category: "soap", image: luxImage },
    { name: "Palmolive", category: "soap", image: palmoliveImage },
    { name: "Head & Shoulders", category: "shampoo", image: headShouldersImage },
    { name: "Pantene", category: "shampoo", image: panteneImage },
    { name: "Colgate", category: "toothpaste", image: colgateImage },
    { name: "Sensodyne", category: "toothpaste", image: sensodyneImage },
    { name: "Charmin", category: "toilet-paper", image: charminImage },
    { name: "Scott", category: "toilet-paper", image: scottImage },
    { name: "Fairy", category: "dishwashing-liquid", image: fairyImage },
    { name: "Tide", category: "laundry-detergent", image: tideImage },
    { name: "Downy", category: "fabric-softener", image: downyImage },
];

const Product = () => {
    const [search, setSearch] = useState("");
    const [category, setCategory] = useState("all");
    const [filteredProducts, setFilteredProducts] = useState(products);

    useEffect(() => {
        const filtered = products.filter(product =>
            (category === "all" || product.category === category) &&
            product.name.toLowerCase().includes(search.toLowerCase())
        );
        setFilteredProducts(filtered);
    }, [search, category]);

    return (
        <div>
            {/* Navbar */}
            <nav className="navbar">
                <div className="logo">Velavan Super Stores</div>
                <ul className="nav-links">
                    <li><Link to="/" className="nav-item">Home</Link></li>
                    <li><Link to="/products" className="nav-item">Products</Link></li>
                    <li><Link to="/cart" className="nav-item">Cart</Link></li>
                    <li><Link to="/invoice" className="nav-item">Invoice</Link></li>
                    <li><button className="logout-btn">Log Out</button></li>
                </ul>
            </nav>

            {/* Search Bar */}
            <div className="search-bar">
                <select value={category} onChange={(e) => setCategory(e.target.value)}>
                    <option value="all">All Categories</option>
                    <option value="soap">Soap</option>
                    <option value="shampoo">Shampoo</option>
                    <option value="toothpaste">Toothpaste</option>
                    <option value="toilet-paper">Toilet Paper</option>
                    <option value="dishwashing-liquid">Dishwashing Liquid</option>
                    <option value="laundry-detergent">Laundry Detergent</option>
                    <option value="fabric-softener">Fabric Softener</option>
                </select>
                <input 
                    type="text" 
                    className="search-input" 
                    placeholder="Search products..." 
                    value={search} 
                    onChange={(e) => setSearch(e.target.value)}
                />
            </div>

            {/* Products Grid */}
            <div className="product-grid">
                {filteredProducts.map((product, index) => (
                    <div key={index} className="product-card">
                        <img src={product.image} alt={product.name} className="product-image"/>
                        <p className="product-name">{product.name}</p>
                    </div>
                ))}
            </div>
        </div>
    );
};

export default Product;
